script: |
  super -f tsv -I q9943.sql | sort > q9943.out

inputs:
  - name: q9943.sql
    data: |
      SELECT ALL - cor0.col1 + - NULLIF ( - 99 + + cor0.col0 / cor0.col0, - cor0.col1 ) AS col1 FROM tab2 AS cor0 GROUP BY cor0.col1, col0;
  - name: tab2

outputs:
  - name: q9943.out
    data: |
      37
      39
      57
